CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_make_payment_v5`(
    IN p_billing_id INT,
    IN p_payor_id INT,                   -- optional (can be NULL)
    IN p_amount_paid DECIMAL(10,2),      -- main bill payment
